import React from 'react'

var stylingObject = {
    container: {
        display: "flex",
        width: "100%",
        height: "500px",
        background: "red",
        padding: "0 20rem"
    }
}

function Hero() {
    return (
        <div style = {stylingObject.container}>
            <div style = {stylingObject.textContainer}>
                <h1>Header</h1>
                <h3>Subheader</h3>
            </div>
            <div style = {stylingObject.imageContainer}>
                <image src='../assets/ChefImage.png' width="300px" height="300px"></image>
            </div>
        </div>
    )
}

export default Hero
